import React, { Component } from 'react';
import YouTube from 'react-youtube';
import axios from 'axios';

class YouTubeComp extends Component {
    constructor(props) {
        super(props);
        this.state = {
            vidId: null,

        };
    }

    render() {
        const options = {
            height: '390',
            width: '640',
            playerVars: {
                autoplay: 0,
            },
        };

        return (
            <div>
                <YouTube videoId={this.state.vidId} opts={options} />
            </div>
        );
    }
}

export default YouTubeComp;
